import { BMI, ASCAP, SESAC, GMR, HFA } from "./images";

const PROs = () => {
  return (
    <div>
      <img src={BMI} alt="" />
      <img src={ASCAP} alt="" />
      <img src={SESAC} alt="" />
      <img src={GMR} alt="" />
      <img src={HFA} alt="" />
    </div>
  );
};

export default PROs;
